E html\u003e\n            \u003chtml\u003e\n            \u003chead\u003e\n                \u003ctitle\u003eEngine Information Summary\u003c/title\u003e\n                \u003clink rel=\"stylesheet\" href=\"https://stackpath.bootstrapcdn.com/bootstrap/4.3.1/css/bootstrap.min.css\"\u003e\n                \u003cstyle\u003e\n                    body { font-family: \"Bahnschrift\", sans-serif; margin: 0; padding: 0; }\n                    .container { max-width: 100%; margin: auto; padding: 20px; padding-right: 0; padding-left: 0; }\n                    h1 { text-align: left; margin-bottom: 20px; font-size: 24px; padding-left: 15px;}\n                    .table-striped tbody tr:nth-of-type(odd) {\n                        background-color: #ecf3f5; /* Light blue */\n                    }\n                    .table td, .table th {\n                        font-family: \"Bahnschrift\", sans-serif;\n                        font-weight: normal;\n                    }\n                    /* Make the first column bold */\n                    .table th:nth-child(1), .table td:nth-child(1) {\n                        font-weight: bold; /* Apply bold font weight */\n                        width: 25%; /* Adjust width as needed */\n                    }\n                    /* Make the header of the second column bold */\n                    .table th:nth-child(2) {\n                        font-weight: bold; /* Apply bold font weight */\n                        font-family: \"Bahnschrift\", sans-serif; /* Ensuring font consistency */\n                    }\n                \u003c/style\u003e\n            \u003c/head\u003e\n            \u003cbody\u003e\n                \n                \u003cdiv class=\"container\"\u003e\n                    \u003ch1\u003eAOI Report\u003c/h1\u003e\n                    \u003ctable class=\"dataframe table table-striped table-hover\"\u003e\n            \u003cthead\u003e\n                \u003ctr style=\"text-align: left;\"\u003e\n                \u003cth\u003eKey Words\u003c/th\u003e\n                \u003cth\u003eDescription\u003c/th\u003e\n                \u003c/tr\u003e\n            \u003c/thead\u003e\n            \u003ctbody\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eDevice Drop Down Menu\u003c/td\u003e\n                \u003ctd\u003eThis is a dropdown menu that allows the user to select a device from the list of devices.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eStart and End Dates\u003c/td\u003e\n                \u003ctd\u003eShows the start and end dates of the selected period of time.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eTotal Hits\u003c/td\u003e\n                \u003ctd\u003eShows the total number of hits recorded in the selected period of time.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eTotal Days\u003c/td\u003e\n                \u003ctd\u003eShows the total number of days recorded in the selected period of time.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eGeospatial Confidence Metrics\u003c/td\u003e\n                \u003ctd\u003eShows the geospatial confidence metrics for the selected device.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eNumber of Hits Per Day of the Week\u003c/td\u003e\n                \u003ctd\u003eShows the number of hits per day of the week for the selected device.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eNumber of Hits Per Month\u003c/td\u003e\n                \u003ctd\u003eShows the number of hits per month for the selected device.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eLocation Likelihood with respect to Day of Week\u003c/td\u003e\n                \u003ctd\u003eShows the location likelihood with respect to day of week for the selected device.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eEstimated Current Location\u003c/td\u003e\n                \u003ctd\u003eShows the estimated current location for the selected device based on the device history and the current time. This also shows the expected duration of stay at the current location along with the potential next location and the latter\u0027s confidence score.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eDuration per Location with respect to Day of Week\u003c/td\u003e\n                \u003ctd\u003eShows the duration per location with respect to day of week for the selected device.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003ePredicted Itenirary at current time\u003c/td\u003e\n                \u003ctd\u003eShows the path taken by the device from the latest location to the next location.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003ePredicted Itenirary at current time AntPath\u003c/td\u003e\n                \u003ctd\u003eShows the path taken by the device from the latest location to the next location.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eMap\u003c/td\u003e\n                \u003ctd\u003eAn interactive map that shows the location of the selected device along with its coordinates, type, and number of hits.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eAOIs Summary Statistics\u003c/td\u003e\n                \u003ctd\u003eShows the different AOIs for the selected device along with their coordinates, type, number of hits, and total days recorded.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eSuspiciousness Evaluation\u003c/td\u003e\n                \u003ctd\u003eShows the suspiciousness evaluation for the selected device. This evaluation is based on how likely this device is to be in location or not based on its history.\u003c/td\u003e\n                \u003c/tr\u003e\n            \u003c/tbody\u003e\n            \u003c/table\u003e\n                \u003c/div\u003e\n            \n                \u003cdiv class=\"container\"\u003e\n                    \u003ch1\u003eConsistency Metrics\u003c/h1\u003e\n                    \u003ctable class=\"dataframe table table-striped table-hover\"\u003e\n            \u003cthead\u003e\n                \u003ctr style=\"text-align: left;\"\u003e\n                \u003cth\u003eMetrics\u003c/th\u003e\n                \u003cth\u003eDescription\u003c/th\u003e\n                \u003c/tr\u003e\n            \u003c/thead\u003e\n            \u003ctbody\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eTime Period Consistency\u003c/td\u003e\n                \u003ctd\u003eThis metric evaluates the consistency of days recorded over the specified period of time.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eHour of Day Consistency\u003c/td\u003e\n                \u003ctd\u003eThis metric assesses the consistency of data recorded throughout the day.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eDay of Week Consistency\u003c/td\u003e\n                \u003ctd\u003eThis metric assesses the consistency of recorded data with respect to the Day of Week.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eHits Per Day Consistency\u003c/td\u003e\n                \u003ctd\u003eThis metric evaluates the consistency of activity levels recorded per day, providing insights into user behavior patterns throughout a day.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eConfidence Score\u003c/td\u003e\n                \u003ctd\u003eThis score provides an overall measure of confidence in the analysis results, based on the availability and consistency of geospatial data. This metrics, based on the aforementioned consistency metrics, ranges between 0 and 100, and indicates that the data and analysis results are reliable the higher this score is.\u003c/td\u003e\n                \u003c/tr\u003e\n            \u003c/tbody\u003e\n            \u003c/table\u003e\n                \u003c/div\u003e\n            \u003c!-- Additional HTML content will be inserted here based on flags --\u003e\n            \u003c/body\u003e\n            \u003c/html\u003e]]\u003e\u003c/HTML\u003e\u003c/Group\u003e\u003c/Group\u003e\u003c/Select\u003e\u003c/View\u003e", "assets": {"945815bce3": {"src": "data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAA30AAANKCAYAAAA+9SesAAAAGXRFWHRTb2Z0d2FyZQBBZG9iZSBJbWFnZVJlYWR5ccllPAAAQ3xJREFUeNrs3U2MXceCH/bDfvTMYOhALRgzfoMBRleOQ4fwgs1FNt7wcsUgWohcTDZZsLkzkAAkFwmyI7kLYgMkkeDFWQS83BhwslBrQQNa8TKrAF6wtTCUCHjRlYMAgT2D1wqieB5eRsqpZl3pqtUku/tU1alzzu8HXLT0ZnQ/6nzVvz6bBgAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAA 632193f\"/\u003e\u003cSelect type=\"tabs\"\u003e\u003cDataTable type=\"application/vnd.apache.arrow+binary\" label=\"AOIs Summary Statistics\" rows=\"4\" columns=\"8\" schema=\"[]\" src=\"ref://ef3fc92879\"/\u003e\u003cText label=\"Suspiciousness Evaluation\"\u003e\u003c![CDATA[Suspiciousness Evaluation is Currently Unavailable]]\u003e\u003c/Text\u003e\u003c/Select\u003e\u003c/Group\u003e\u003c/Group\u003e\u003c/Group\u003e\u003c/Group\u003e\u003cGroup label=\"Information Page\" columns=\"1\" valign=\"top\"\u003e\u003cGroup columns=\"1\" valign=\"top\"\u003e\u003cHTML\u003e\u003c![CDATA[\u003c!DOCTYPE html\u003e\n            \u003chtml\u003e\n            \u003chead\u003e\n                \u003ctitle\u003eEngine Information Summary\u003c/title\u003e\n                \u003clink rel=\"stylesheet\" href=\"https://stackpath.bootstrapcdn.com/bootstrap/4.3.1/css/bootstrap.min.css\"\u003e\n                \u003cstyle\u003e\n                    body { font-family: \"Bahnschrift\", sans-serif; margin: 0; padding: 0; }\n                    .container { max-width: 100%; margin: auto; padding: 20px; padding-right: 0; padding-left: 0; }\n                    h1 { text-align: left; margin-bottom: 20px; font-size: 24px; padding-left: 15px;}\n                    .table-striped tbody tr:nth-of-type(odd) {\n                        background-color: #ecf3f5; /* Light blue */\n                    }\n                    .table td, .table th {\n                        font-family: \"Bahnschrift\", sans-serif;\n                        font-weight: normal;\n                    }\n                    /* Make the first column bold */\n                    .table th:nth-child(1), .table td:nth-child(1) {\n                        font-weight: bold; /* Apply bold font weight */\n                        width: 25%; /* Adjust width as needed */\n                    }\n                    /* Make the header of the second column bold */\n                    .table th:nth-child(2) {\n                        font-weight: bold; /* Apply bold font weight */\n                        font-family: \"Bahnschrift\", sans-serif; /* Ensuring font consistency */\n                    }\n                \u003c/style\u003e\n            \u003c/head\u003e\n            \u003cbody\u003e\n                \n                \u003cdiv class=\"container\"\u003e\n                    \u003ch1\u003eAOI Report\u003c/h1\u003e\n                    \u003ctable class=\"dataframe table table-striped table-hover\"\u003e\n            \u003cthead\u003e\n                \u003ctr style=\"text-align: left;\"\u003e\n                \u003cth\u003eKey Words\u003c/th\u003e\n                \u003cth\u003eDescription\u003c/th\u003e\n                \u003c/tr\u003e\n            \u003c/thead\u003e\n            \u003ctbody\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eDevice Drop Down Menu\u003c/td\u003e\n                \u003ctd\u003eThis is a dropdown menu that allows the user to select a device from the list of devices.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eStart and End Dates\u003c/td\u003e\n                \u003ctd\u003eShows the start and end dates of the selected period of time.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eTotal Hits\u003c/td\u003e\n                \u003ctd\u003eShows the total number of hits recorded in the selected period of time.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eTotal Days\u003c/td\u003e\n                \u003ctd\u003eShows the total number of days recorded in the selected period of time.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eGeospatial Confidence Metrics\u003c/td\u003e\n                \u003ctd\u003eShows the geospatial confidence metrics for the selected device.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eNumber of Hits Per Day of the Week\u003c/td\u003e\n                \u003ctd\u003eShows the number of hits per day of the week for the selected device.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eNumber of Hits Per Month\u003c/td\u003e\n                \u003ctd\u003eShows the number of hits per month for the selected device.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eLocation Likelihood with respect to Day of Week\u003c/td\u003e\n                \u003ctd\u003eShows the location likelihood with respect to day of week for the selected device.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eEstimated Current Location\u003c/td\u003e\n                \u003ctd\u003eShows the estimated current location for the selected device based on the device history and the current time. This also shows the expected duration of stay at the current location along with the potential next location and the latter\u0027s confidence score.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eDuration per Location with respect to Day of Week\u003c/td\u003e\n                \u003ctd\u003eShows the duration per location with respect to day of week for the selected device.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003ePredicted Itenirary at current time\u003c/td\u003e\n                \u003ctd\u003eShows the path taken by the device from the latest location to the next location.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003ePredicted Itenirary at current time AntPath\u003c/td\u003e\n                \u003ctd\u003eShows the path taken by the device from the latest location to the next location.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eMap\u003c/td\u003e\n                \u003ctd\u003eAn interactive map that shows the location of the selected device along with its coordinates, type, and number of hits.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eAOIs Summary Statistics\u003c/td\u003e\n                \u003ctd\u003eShows the different AOIs for the selected device along with their coordinates, type, number of hits, and total days recorded.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eSuspiciousness Evaluation\u003c/td\u003e\n                \u003ctd\u003eShows the suspiciousness evaluation for the selected device. This evaluation is based on how likely this device is to be in location or not based on its history.\u003c/td\u003e\n                \u003c/tr\u003e\n            \u003c/tbody\u003e\n            \u003c/table\u003e\n                \u003c/div\u003e\n            \n                \u003cdiv class=\"container\"\u003e\n                    \u003ch1\u003eConsistency Metrics\u003c/h1\u003e\n                    \u003ctable class=\"dataframe table table-striped table-hover\"\u003e\n            \u003cthead\u003e\n                \u003ctr style=\"text-align: left;\"\u003e\n                \u003cth\u003eMetrics\u003c/th\u003e\n                \u003cth\u003eDescription\u003c/th\u003e\n                \u003c/tr\u003e\n            \u003c/thead\u003e\n            \u003ctbody\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eTime Period Consistency\u003c/td\u003e\n                \u003ctd\u003eThis metric evaluates the consistency of days recorded over the specified period of time.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eHour of Day Consistency\u003c/td\u003e\n                \u003ctd\u003eThis metric assesses the consistency of data recorded throughout the day.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eDay of Week Consistency\u003c/td\u003e\n                \u003ctd\u003eThis metric assesses the consistency of recorded data with respect to the Day of Week.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eHits Per Day Consistency\u003c/td\u003e\n                \u003ctd\u003eThis metric evaluates the consistency of activity levels recorded per day, providing insights into user behavior patterns throughout a day.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eConfidence Score\u003c/td\u003e\n                \u003ctd\u003eThis score provides an overall measure of confidence in the analysis results, based on the availability and consistency of geospatial data. This metrics, based on the aforementioned consistency metrics, ranges between 0 and 100, and indicates that the data and analysis results are reliable the higher this score is.\u003c/td\u003e\n                \u003c/tr\u003e\n            \u003c/tbody\u003e\n            \u003c/table\u003e\n                \u003c/div\u003e\n            \u003c!-- Additional HTML content will be inserted here based on flags --\u003e\n            \u003c/body\u003e\n            \u003c/html\u003e]]\u003e\u003c/HTML\u003e\u003c/Group\u003e\u003c/Group\u003e\u003c/Select\u003e\u003c/View\u003e", "assets": {"945815bce3": {"src": "data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAA30AAANKCAYAAAA+9SesAAAAGXRFWHRTb2Z0d2FyZQBBZG9iZSBJbWFnZVJlYWR5ccllPAAAQ3xJREFUeNrs3U2MXceCH/bDfvTMYOhALRgzfoMBRleOQ4fwgs1FNt7wcsUgWohcTDZZsLkzkAAkFwmyI7kLYgMkkeDFWQS83BhwslBrQQNa8TKrAF6wtTCUCHjRlYMAgT2D1wqieB5eRsqpZl3pqtUku/tU1alzzu8HXLT0ZnQ/6nzVvz6bBgAAAAAAAAAAAAAAAAAAAAAAAAAA or remove the default class\n                    if (button.classList.contains(\u0027active-color\u0027)) {\n                        button.classList.remove(\u0027default-color\u0027);\n                    } else {\n                        button.classList.add(\u0027default-color\u0027);\n                    }\n                    \n                    // Toggle content visibility\n                    if (content.style.display === \u0027none\u0027 || content.style.display === \u0027\u0027) {\n                        content.style.display = \u0027block\u0027;\n                        setTimeout(function() {\n                            content.style.opacity = 1;\n                        }, 10); // Short delay before starting opacity transition to ensure it is smooth\n                    } else {\n                        content.style.opacity = 0;\n                        setTimeout(function() {\n                            content.style.display = \u0027none\u0027;\n                        }, 500); // Delay hiding the div until after the opacity transition finishes\n                    }\n                }\n            \u003c/script\u003e\n            \u003c/body\u003e\n            \u003c/html\u003e]]\u003e\u003c/HTML\u003e\u003c/Group\u003e\u003c/Group\u003e\u003c/Select\u003e\u003cGroup columns=\"1\" valign=\"top\"\u003e\u003cText\u003e\u003c![CDATA[### Estimated Current Location]]\u003e\u003c/Text\u003e\u003cGroup label=\"Estimated Current Location\" columns=\"1\" valign=\"top\"\u003e\u003cGroup columns=\"2\" valign=\"top\"\u003e\u003cBigNumber heading=\"Current Day Of Week\" value=\"Wednesday\" is_positive_intent=\"false\" is_upward_change=\"false\"/\u003e\u003cBigNumber heading=\"Current Hour Of Day\" value=\"15\" is_positive_intent=\"false\" is_upward_change=\"false\"/\u003e\u003c/Group\u003e\u003cBigNumber heading=\"Likely Current Location\" value=\"(33.92989037, 35.58852951)\" is_positive_intent=\"false\" is_upward_change=\"false\"/\u003e\u003c/Group\u003e\u003c/Group\u003e\u003cPlot type=\"application/vnd.folium+html\" label=\"Device AOIs\" responsive=\"true\" scale=\"1.0\" src=\"ref://e14891075a\"/\u003e\u003cSelect type=\"tabs\"\u003e\u003cDataTable type=\"application/vnd.apache.arrow+binary\" label=\"AOIs Summary Statistics\" rows=\"1\" columns=\"8\" schema=\"[]\" src=\"ref://592fff8d0f\"/\u003e\u003cText label=\"Suspiciousness Evaluation\"\u003e\u003c![CDATA[Suspiciousness Evaluation is Currently Unavailable]]\u003e\u003c/Text\u003e\u003c/Select\u003e\u003c/Group\u003e\u003c/Select\u003e\u003c/Group\u003e\u003c/Group\u003e\u003cGroup label=\"Information Page\" columns=\"1\" valign=\"top\"\u003e\u003cGroup columns=\"1\" valign=\"top\"\u003e\u003cHTML\u003e\u003c![CDATA[\u003c!DOCTYPE html\u003e\n            \u003chtml\u003e\n            \u003chead\u003e\n                \u003ctitle\u003eEngine Information Summary\u003c/title\u003e\n                \u003clink rel=\"stylesheet\" href=\"https://stackpath.bootstrapcdn.com/bootstrap/4.3.1/css/bootstrap.min.css\"\u003e\n                \u003cstyle\u003e\n                    body { font-family: \"Bahnschrift\", sans-serif; margin: 0; padding: 0; }\n                    .container { max-width: 100%; margin: auto; padding: 20px; padding-right: 0; padding-left: 0; }\n                    h1 { text-align: left; margin-bottom: 20px; font-size: 24px; padding-left: 15px;}\n                    .table-striped tbody tr:nth-of-type(odd) {\n                        background-color: #ecf3f5; /* Light blue */\n                    }\n                    .table td, .table th {\n                        font-family: \"Bahnschrift\", sans-serif;\n                        font-weight: normal;\n                    }\n                    /* Make the first column bold */\n                    .table th:nth-child(1), .table td:nth-child(1) {\n                        font-weight: bold; /* Apply bold font weight */\n                        width: 25%; /* Adjust width as needed */\n                    }\n                    /* Make the header of the second column bold */\n                    .table th:nth-child(2) {\n                        font-weight: bold; /* Apply bold font weight */\n                        font-family: \"Bahnschrift\", sans-serif; /* Ensuring font consistency */\n                    }\n                \u003c/style\u003e\n            \u003c/head\u003e\n            \u003cbody\u003e\n                \n                \u003cdiv class=\"container\"\u003e\n                    \u003ch1\u003eAOI Report\u003c/h1\u003e\n                    \u003ctable class=\"dataframe table table-striped table-hover\"\u003e\n            \u003cthead\u003e\n                \u003ctr style=\"text-align: left;\"\u003e\n                \u003cth\u003eKey Words\u003c/th\u003e\n                \u003cth\u003eDescription\u003c/th\u003e\n                \u003c/tr\u003e\n            \u003c/thead\u003e\n            \u003ctbody\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eDevice Drop Down Menu\u003c/td\u003e\n                \u003ctd\u003eThis is a dropdown menu that allows the user to select a device from the list of devices.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eStart and End Dates\u003c/td\u003e\n                \u003ctd\u003eShows the start and end dates of the selected period of time.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eTotal Hits\u003c/td\u003e\n                \u003ctd\u003eShows the total number of hits recorded in the selected period of time.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eTotal Days\u003c/td\u003e\n                \u003ctd\u003eShows the total number of days recorded in the selected period of time.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eGeospatial Confidence Metrics\u003c/td\u003e\n                \u003ctd\u003eShows the geospatial confidence metrics for the selected device.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eNumber of Hits Per Day of the Week\u003c/td\u003e\n                \u003ctd\u003eShows the number of hits per day of the week for the selected device.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eNumber of Hits Per Month\u003c/td\u003e\n                \u003ctd\u003eShows the number of hits per month for the selected device.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eLocation Likelihood with respect to Day of Week\u003c/td\u003e\n                \u003ctd\u003eShows the location likelihood with respect to day of week for the selected device.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eEstimated Current Location\u003c/td\u003e\n                \u003ctd\u003eShows the estimated current location for the selected device based on the device history and the current time. This also shows the expected duration of stay at the current location along with the potential next location and the latter\u0027s confidence score.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eDuration per Location with respect to Day of Week\u003c/td\u003e\n                \u003ctd\u003eShows the duration per location with respect to day of week for the selected device.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003ePredicted Itenirary at current time\u003c/td\u003e\n                \u003ctd\u003eShows the path taken by the device from the latest location to the next location.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003ePredicted Itenirary at current time AntPath\u003c/td\u003e\n                \u003ctd\u003eShows the path taken by the device from the latest location to the next location.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eMap\u003c/td\u003e\n                \u003ctd\u003eAn interactive map that shows the location of the selected device along with its coordinates, type, and number of hits.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eAOIs Summary Statistics\u003c/td\u003e\n                \u003ctd\u003eShows the different AOIs for the selected device along with their coordinates, type, number of hits, and total days recorded.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eSuspiciousness Evaluation\u003c/td\u003e\n                \u003ctd\u003eShows the suspiciousness evaluation for the selected device. This evaluation is based on how likely this device is to be in location or not based on its history.\u003c/td\u003e\n                \u003c/tr\u003e\n            \u003c/tbody\u003e\n            \u003c/table\u003e\n                \u003c/div\u003e\n            \n                \u003cdiv class=\"container\"\u003e\n                    \u003ch1\u003eConsistency Metrics\u003c/h1\u003e\n                    \u003ctable class=\"dataframe table table-striped table-hover\"\u003e\n            \u003cthead\u003e\n                \u003ctr style=\"text-align: left;\"\u003e\n                \u003cth\u003eMetrics\u003c/th\u003e\n                \u003cth\u003eDescription\u003c/th\u003e\n                \u003c/tr\u003e\n            \u003c/thead\u003e\n            \u003ctbody\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eTime Period Consistency\u003c/td\u003e\n                \u003ctd\u003eThis metric evaluates the consistency of days recorded over the specified period of time.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eHour of Day Consistency\u003c/td\u003e\n                \u003ctd\u003eThis metric assesses the consistency of data recorded throughout the day.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eDay of Week Consistency\u003c/td\u003e\n                \u003ctd\u003eThis metric assesses the consistency of recorded data with respect to the Day of Week.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eHits Per Day Consistency\u003c/td\u003e\n                \u003ctd\u003eThis metric evaluates the consistency of activity levels recorded per day, providing insights into user behavior patterns throughout a day.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eConfidence Score\u003c/td\u003e\n                \u003ctd\u003eThis score provides an overall measure of confidence in the analysis results, based on the availability and consistency of geospatial data. This metrics, based on the aforementioned consistency metrics, ranges between 0 and 100, and indicates that the data and analysis results are reliable the higher this score is.\u003c/td\u003e\n                \u003c/tr\u003e\n            \u003c/tbody\u003e\n            \u003c/table\u003e\n                \u003c/div\u003e\n            \u003c!-- Additional HTML content will be inserted here based on flags --\u003e\n            \u003c/body\u003e\n            \u003c/html\u003e]]\u003e\u003c/HTML\u003e\u003c/Group\u003e\u003c/Group\u003e\u003c/Select\u003e\u003c/View\u003e", "assets": {"945815bce3": {"src": "data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAA30AAANKCAYAAAA+9SesAAAAGXRFWHRTb2Z0d2FyZQBBZG9iZSBJbWFnZVJlYWR5ccllPAAAQ3xJREFUeNrs3U2MXceCH/bDfvTMYOhALRgzfoMBRleOQ4fwgs1FNt7wcsUgWohcTDZZsLkzkA pe=\"tabs\"\u003e\u003cDataTable type=\"application/vnd.apache.arrow+binary\" label=\"AOIs Summary Statistics\" rows=\"1\" columns=\"8\" schema=\"[]\" src=\"ref://d4086cd535\"/\u003e\u003cText label=\"Suspiciousness Evaluation\"\u003e\u003c![CDATA[Suspiciousness Evaluation is Currently Unavailable]]\u003e\u003c/Text\u003e\u003c/Select\u003e\u003c/Group\u003e\u003c/Select\u003e\u003c/Group\u003e\u003c/Group\u003e\u003cGroup label=\"Information Page\" columns=\"1\" valign=\"top\"\u003e\u003cGroup columns=\"1\" valign=\"top\"\u003e\u003cHTML\u003e\u003c![CDATA[\u003c!DOCTYPE html\u003e\n            \u003chtml\u003e\n            \u003chead\u003e\n                \u003ctitle\u003eEngine Information Summary\u003c/title\u003e\n                \u003clink rel=\"stylesheet\" href=\"https://stackpath.bootstrapcdn.com/bootstrap/4.3.1/css/bootstrap.min.css\"\u003e\n                \u003cstyle\u003e\n                    body { font-family: \"Bahnschrift\", sans-serif; margin: 0; padding: 0; }\n                    .container { max-width: 100%; margin: auto; padding: 20px; padding-right: 0; padding-left: 0; }\n                    h1 { text-align: left; margin-bottom: 20px; font-size: 24px; padding-left: 15px;}\n                    .table-striped tbody tr:nth-of-type(odd) {\n                        background-color: #ecf3f5; /* Light blue */\n                    }\n                    .table td, .table th {\n                        font-family: \"Bahnschrift\", sans-serif;\n                        font-weight: normal;\n                    }\n                    /* Make the first column bold */\n                    .table th:nth-child(1), .table td:nth-child(1) {\n                        font-weight: bold; /* Apply bold font weight */\n                        width: 25%; /* Adjust width as needed */\n                    }\n                    /* Make the header of the second column bold */\n                    .table th:nth-child(2) {\n                        font-weight: bold; /* Apply bold font weight */\n                        font-family: \"Bahnschrift\", sans-serif; /* Ensuring font consistency */\n                    }\n                \u003c/style\u003e\n            \u003c/head\u003e\n            \u003cbody\u003e\n                \n                \u003cdiv class=\"container\"\u003e\n                    \u003ch1\u003eAOI Report\u003c/h1\u003e\n                    \u003ctable class=\"dataframe table table-striped table-hover\"\u003e\n            \u003cthead\u003e\n                \u003ctr style=\"text-align: left;\"\u003e\n                \u003cth\u003eKey Words\u003c/th\u003e\n                \u003cth\u003eDescription\u003c/th\u003e\n                \u003c/tr\u003e\n            \u003c/thead\u003e\n            \u003ctbody\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eDevice Drop Down Menu\u003c/td\u003e\n                \u003ctd\u003eThis is a dropdown menu that allows the user to select a device from the list of devices.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eStart and End Dates\u003c/td\u003e\n                \u003ctd\u003eShows the start and end dates of the selected period of time.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eTotal Hits\u003c/td\u003e\n                \u003ctd\u003eShows the total number of hits recorded in the selected period of time.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eTotal Days\u003c/td\u003e\n                \u003ctd\u003eShows the total number of days recorded in the selected period of time.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eGeospatial Confidence Metrics\u003c/td\u003e\n                \u003ctd\u003eShows the geospatial confidence metrics for the selected device.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eNumber of Hits Per Day of the Week\u003c/td\u003e\n                \u003ctd\u003eShows the number of hits per day of the week for the selected device.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eNumber of Hits Per Month\u003c/td\u003e\n                \u003ctd\u003eShows the number of hits per month for the selected device.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eLocation Likelihood with respect to Day of Week\u003c/td\u003e\n                \u003ctd\u003eShows the location likelihood with respect to day of week for the selected device.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eEstimated Current Location\u003c/td\u003e\n                \u003ctd\u003eShows the estimated current location for the selected device based on the device history and the current time. This also shows the expected duration of stay at the current location along with the potential next location and the latter\u0027s confidence score.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eDuration per Location with respect to Day of Week\u003c/td\u003e\n                \u003ctd\u003eShows the duration per location with respect to day of week for the selected device.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003ePredicted Itenirary at current time\u003c/td\u003e\n                \u003ctd\u003eShows the path taken by the device from the latest location to the next location.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003ePredicted Itenirary at current time AntPath\u003c/td\u003e\n                \u003ctd\u003eShows the path taken by the device from the latest location to the next location.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eMap\u003c/td\u003e\n                \u003ctd\u003eAn interactive map that shows the location of the selected device along with its coordinates, type, and number of hits.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eAOIs Summary Statistics\u003c/td\u003e\n                \u003ctd\u003eShows the different AOIs for the selected device along with their coordinates, type, number of hits, and total days recorded.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eSuspiciousness Evaluation\u003c/td\u003e\n                \u003ctd\u003eShows the suspiciousness evaluation for the selected device. This evaluation is based on how likely this device is to be in location or not based on its history.\u003c/td\u003e\n                \u003c/tr\u003e\n            \u003c/tbody\u003e\n            \u003c/table\u003e\n                \u003c/div\u003e\n            \n                \u003cdiv class=\"container\"\u003e\n                    \u003ch1\u003eConsistency Metrics\u003c/h1\u003e\n                    \u003ctable class=\"dataframe table table-striped table-hover\"\u003e\n            \u003cthead\u003e\n                \u003ctr style=\"text-align: left;\"\u003e\n                \u003cth\u003eMetrics\u003c/th\u003e\n                \u003cth\u003eDescription\u003c/th\u003e\n                \u003c/tr\u003e\n            \u003c/thead\u003e\n            \u003ctbody\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eTime Period Consistency\u003c/td\u003e\n                \u003ctd\u003eThis metric evaluates the consistency of days recorded over the specified period of time.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eHour of Day Consistency\u003c/td\u003e\n                \u003ctd\u003eThis metric assesses the consistency of data recorded throughout the day.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eDay of Week Consistency\u003c/td\u003e\n                \u003ctd\u003eThis metric assesses the consistency of recorded data with respect to the Day of Week.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eHits Per Day Consistency\u003c/td\u003e\n                \u003ctd\u003eThis metric evaluates the consistency of activity levels recorded per day, providing insights into user behavior patterns throughout a day.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eConfidence Score\u003c/td\u003e\n                \u003ctd\u003eThis score provides an overall measure of confidence in the analysis results, based on the availability and consistency of geospatial data. This metrics, based on the aforementioned consistency metrics, ranges between 0 and 100, and indicates that the data and analysis results are reliable the higher this score is.\u003c/td\u003e\n                \u003c/tr\u003e\n            \u003c/tbody\u003e\n            \u003c/table\u003e\n                \u003c/div\u003e\n            \u003c!-- Additional HTML content will be inserted here based on flags --\u003e\n            \u003c/body\u003e\n            \u003c/html\u003e]]\u003e\u003c/HTML\u003e\u003c/Group\u003e\u003c/Group\u003e\u003c/Select\u003e\u003c/View\u003e", "assets": {"945815bce3": {"src": "data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAA30AAANKCAYAAAA+9SesAAAAGXRFWHRTb2Z0d2FyZQBBZG9iZSBJbWFnZVJlYWR5ccllPAAAQ3xJREFUeNrs3U2MXceCH/bDfvTMYOhALRgzfoMBRleOQ4fwgs1FNt7wcsUgWohcTDZZsLkzkAAkFwmyI7kLYgMkkeDFWQS83BhwslBrQQNa8TKrAF6wtTCUCHjRlYMAgT2D1wqieB5eRsqpZl3pqtUku/tU1alzzu8HXLT0ZnQ/6nzVvz6bBgAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAA ef=\"https://stackpath.bootstrapcdn.com/bootstrap/4.3.1/css/bootstrap.min.css\"\u003e\n                \u003cstyle\u003e\n                    body { font-family: \"Bahnschrift\", sans-serif; margin: 0; padding: 0; }\n                    .container { max-width: 100%; margin: auto; padding: 20px; padding-right: 0; padding-left: 0; }\n                    h1 { text-align: left; margin-bottom: 20px; font-size: 24px; padding-left: 15px;}\n                    .table-striped tbody tr:nth-of-type(odd) {\n                        background-color: #ecf3f5; /* Light blue */\n                    }\n                    .table td, .table th {\n                        font-family: \"Bahnschrift\", sans-serif;\n                        font-weight: normal;\n                    }\n                    /* Make the first column bold */\n                    .table th:nth-child(1), .table td:nth-child(1) {\n                        font-weight: bold; /* Apply bold font weight */\n                        width: 25%; /* Adjust width as needed */\n                    }\n                    /* Make the header of the second column bold */\n                    .table th:nth-child(2) {\n                        font-weight: bold; /* Apply bold font weight */\n                        font-family: \"Bahnschrift\", sans-serif; /* Ensuring font consistency */\n                    }\n                \u003c/style\u003e\n            \u003c/head\u003e\n            \u003cbody\u003e\n                \n                \u003cdiv class=\"container\"\u003e\n                    \u003ch1\u003eAOI Report\u003c/h1\u003e\n                    \u003ctable class=\"dataframe table table-striped table-hover\"\u003e\n            \u003cthead\u003e\n                \u003ctr style=\"text-align: left;\"\u003e\n                \u003cth\u003eKey Words\u003c/th\u003e\n                \u003cth\u003eDescription\u003c/th\u003e\n                \u003c/tr\u003e\n            \u003c/thead\u003e\n            \u003ctbody\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eDevice Drop Down Menu\u003c/td\u003e\n                \u003ctd\u003eThis is a dropdown menu that allows the user to select a device from the list of devices.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eStart and End Dates\u003c/td\u003e\n                \u003ctd\u003eShows the start and end dates of the selected period of time.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eTotal Hits\u003c/td\u003e\n                \u003ctd\u003eShows the total number of hits recorded in the selected period of time.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eTotal Days\u003c/td\u003e\n                \u003ctd\u003eShows the total number of days recorded in the selected period of time.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eGeospatial Confidence Metrics\u003c/td\u003e\n                \u003ctd\u003eShows the geospatial confidence metrics for the selected device.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eNumber of Hits Per Day of the Week\u003c/td\u003e\n                \u003ctd\u003eShows the number of hits per day of the week for the selected device.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eNumber of Hits Per Month\u003c/td\u003e\n                \u003ctd\u003eShows the number of hits per month for the selected device.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eLocation Likelihood with respect to Day of Week\u003c/td\u003e\n                \u003ctd\u003eShows the location likelihood with respect to day of week for the selected device.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eEstimated Current Location\u003c/td\u003e\n                \u003ctd\u003eShows the estimated current location for the selected device based on the device history and the current time. This also shows the expected duration of stay at the current location along with the potential next location and the latter\u0027s confidence score.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eDuration per Location with respect to Day of Week\u003c/td\u003e\n                \u003ctd\u003eShows the duration per location with respect to day of week for the selected device.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003ePredicted Itenirary at current time\u003c/td\u003e\n                \u003ctd\u003eShows the path taken by the device from the latest location to the next location.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003ePredicted Itenirary at current time AntPath\u003c/td\u003e\n                \u003ctd\u003eShows the path taken by the device from the latest location to the next location.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eMap\u003c/td\u003e\n                \u003ctd\u003eAn interactive map that shows the location of the selected device along with its coordinates, type, and number of hits.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eAOIs Summary Statistics\u003c/td\u003e\n                \u003ctd\u003eShows the different AOIs for the selected device along with their coordinates, type, number of hits, and total days recorded.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eSuspiciousness Evaluation\u003c/td\u003e\n                \u003ctd\u003eShows the suspiciousness evaluation for the selected device. This evaluation is based on how likely this device is to be in location or not based on its history.\u003c/td\u003e\n                \u003c/tr\u003e\n            \u003c/tbody\u003e\n            \u003c/table\u003e\n                \u003c/div\u003e\n            \n                \u003cdiv class=\"container\"\u003e\n                    \u003ch1\u003eConsistency Metrics\u003c/h1\u003e\n                    \u003ctable class=\"dataframe table table-striped table-hover\"\u003e\n            \u003cthead\u003e\n                \u003ctr style=\"text-align: left;\"\u003e\n                \u003cth\u003eMetrics\u003c/th\u003e\n                \u003cth\u003eDescription\u003c/th\u003e\n                \u003c/tr\u003e\n            \u003c/thead\u003e\n            \u003ctbody\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eTime Period Consistency\u003c/td\u003e\n                \u003ctd\u003eThis metric evaluates the consistency of days recorded over the specified period of time.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eHour of Day Consistency\u003c/td\u003e\n                \u003ctd\u003eThis metric assesses the consistency of data recorded throughout the day.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eDay of Week Consistency\u003c/td\u003e\n                \u003ctd\u003eThis metric assesses the consistency of recorded data with respect to the Day of Week.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eHits Per Day Consistency\u003c/td\u003e\n                \u003ctd\u003eThis metric evaluates the consistency of activity levels recorded per day, providing insights into user behavior patterns throughout a day.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eConfidence Score\u003c/td\u003e\n                \u003ctd\u003eThis score provides an overall measure of confidence in the analysis results, based on the availability and consistency of geospatial data. This metrics, based on the aforementioned consistency metrics, ranges between 0 and 100, and indicates that the data and analysis results are reliable the higher this score is.\u003c/td\u003e\n                \u003c/tr\u003e\n            \u003c/tbody\u003e\n            \u003c/table\u003e\n                \u003c/div\u003e\n            \u003c!-- Additional HTML content will be inserted here based on flags --\u003e\n            \u003c/body\u003e\n            \u003c/html\u003e]]\u003e\u003c/HTML\u003e\u003c/Group\u003e\u003c/Group\u003e\u003c/Select\u003e\u003c/View\u003e", "assets": {"945815bce3": {"src": "data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAA30AAANKCAYAAAA+9SesAAAAGXRFWHRTb2Z0d2FyZQBBZG9iZSBJbWFnZVJlYWR5ccllPAAAQ3xJREFUeNrs3U2MXceCH/bDfvTMYOhALRgzfoMBRleOQ4fwgs1FNt7wcsUgWohcTDZZsLkzkAAkFwmyI7kLYgMkkeDFWQS83BhwslBrQQNa8TKrAF6wtTCUCHjRlYMAgT2D1wqieB5eRsqpZl3pqtUku/tU1alzzu8HXLT0ZnQ/6nzVvz6bBgAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAA E html\u003e\n            \u003chtml\u003e\n            \u003chead\u003e\n                \u003ctitle\u003eEngine Information Summary\u003c/title\u003e\n                \u003clink rel=\"stylesheet\" href=\"https://stackpath.bootstrapcdn.com/bootstrap/4.3.1/css/bootstrap.min.css\"\u003e\n                \u003cstyle\u003e\n                    body { font-family: \"Bahnschrift\", sans-serif; margin: 0; padding: 0; }\n                    .container { max-width: 100%; margin: auto; padding: 20px; padding-right: 0; padding-left: 0; }\n                    h1 { text-align: left; margin-bottom: 20px; font-size: 24px; padding-left: 15px;}\n                    .table-striped tbody tr:nth-of-type(odd) {\n                        background-color: #ecf3f5; /* Light blue */\n                    }\n                    .table td, .table th {\n                        font-family: \"Bahnschrift\", sans-serif;\n                        font-weight: normal;\n                    }\n                    /* Make the first column bold */\n                    .table th:nth-child(1), .table td:nth-child(1) {\n                        font-weight: bold; /* Apply bold font weight */\n                        width: 25%; /* Adjust width as needed */\n                    }\n                    /* Make the header of the second column bold */\n                    .table th:nth-child(2) {\n                        font-weight: bold; /* Apply bold font weight */\n                        font-family: \"Bahnschrift\", sans-serif; /* Ensuring font consistency */\n                    }\n                \u003c/style\u003e\n            \u003c/head\u003e\n            \u003cbody\u003e\n                \n                \u003cdiv class=\"container\"\u003e\n                    \u003ch1\u003eAOI Report\u003c/h1\u003e\n                    \u003ctable class=\"dataframe table table-striped table-hover\"\u003e\n            \u003cthead\u003e\n                \u003ctr style=\"text-align: left;\"\u003e\n                \u003cth\u003eKey Words\u003c/th\u003e\n                \u003cth\u003eDescription\u003c/th\u003e\n                \u003c/tr\u003e\n            \u003c/thead\u003e\n            \u003ctbody\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eDevice Drop Down Menu\u003c/td\u003e\n                \u003ctd\u003eThis is a dropdown menu that allows the user to select a device from the list of devices.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eStart and End Dates\u003c/td\u003e\n                \u003ctd\u003eShows the start and end dates of the selected period of time.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eTotal Hits\u003c/td\u003e\n                \u003ctd\u003eShows the total number of hits recorded in the selected period of time.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eTotal Days\u003c/td\u003e\n                \u003ctd\u003eShows the total number of days recorded in the selected period of time.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eGeospatial Confidence Metrics\u003c/td\u003e\n                \u003ctd\u003eShows the geospatial confidence metrics for the selected device.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eNumber of Hits Per Day of the Week\u003c/td\u003e\n                \u003ctd\u003eShows the number of hits per day of the week for the selected device.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eNumber of Hits Per Month\u003c/td\u003e\n                \u003ctd\u003eShows the number of hits per month for the selected device.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eLocation Likelihood with respect to Day of Week\u003c/td\u003e\n                \u003ctd\u003eShows the location likelihood with respect to day of week for the selected device.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eEstimated Current Location\u003c/td\u003e\n                \u003ctd\u003eShows the estimated current location for the selected device based on the device history and the current time. This also shows the expected duration of stay at the current location along with the potential next location and the latter\u0027s confidence score.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eDuration per Location with respect to Day of Week\u003c/td\u003e\n                \u003ctd\u003eShows the duration per location with respect to day of week for the selected device.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003ePredicted Itenirary at current time\u003c/td\u003e\n                \u003ctd\u003eShows the path taken by the device from the latest location to the next location.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003ePredicted Itenirary at current time AntPath\u003c/td\u003e\n                \u003ctd\u003eShows the path taken by the device from the latest location to the next location.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eMap\u003c/td\u003e\n                \u003ctd\u003eAn interactive map that shows the location of the selected device along with its coordinates, type, and number of hits.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eAOIs Summary Statistics\u003c/td\u003e\n                \u003ctd\u003eShows the different AOIs for the selected device along with their coordinates, type, number of hits, and total days recorded.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eSuspiciousness Evaluation\u003c/td\u003e\n                \u003ctd\u003eShows the suspiciousness evaluation for the selected device. This evaluation is based on how likely this device is to be in location or not based on its history.\u003c/td\u003e\n                \u003c/tr\u003e\n            \u003c/tbody\u003e\n            \u003c/table\u003e\n                \u003c/div\u003e\n            \n                \u003cdiv class=\"container\"\u003e\n                    \u003ch1\u003eConsistency Metrics\u003c/h1\u003e\n                    \u003ctable class=\"dataframe table table-striped table-hover\"\u003e\n            \u003cthead\u003e\n                \u003ctr style=\"text-align: left;\"\u003e\n                \u003cth\u003eMetrics\u003c/th\u003e\n                \u003cth\u003eDescription\u003c/th\u003e\n                \u003c/tr\u003e\n            \u003c/thead\u003e\n            \u003ctbody\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eTime Period Consistency\u003c/td\u003e\n                \u003ctd\u003eThis metric evaluates the consistency of days recorded over the specified period of time.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eHour of Day Consistency\u003c/td\u003e\n                \u003ctd\u003eThis metric assesses the consistency of data recorded throughout the day.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eDay of Week Consistency\u003c/td\u003e\n                \u003ctd\u003eThis metric assesses the consistency of recorded data with respect to the Day of Week.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eHits Per Day Consistency\u003c/td\u003e\n                \u003ctd\u003eThis metric evaluates the consistency of activity levels recorded per day, providing insights into user behavior patterns throughout a day.\u003c/td\u003e\n                \u003c/tr\u003e\n                \u003ctr\u003e\n                \u003ctd\u003eConfidence Score\u003c/td\u003e\n                \u003ctd\u003eThis score provides an overall measure of confidence in the analysis results, based on the availability and consistency of geospatial data. This metrics, based on the aforementioned consistency metrics, ranges between 0 and 100, and indicates that the data and analysis results are reliable the higher this score is.\u003c/td\u003e\n                \u003c/tr\u003e\n            \u003c/tbody\u003e\n            \u003c/table\u003e\n                \u003c/div\u003e\n            \u003c!-- Additional HTML content will be inserted here based on flags --\u003e\n            \u003c/body\u003e\n            \u003c/html\u003e]]\u003e\u003c/HTML\u003e\u003c/Group\u003e\u003c/Group\u003e\u003c/Select\u003e\u003c/View\u003e", "assets": {"945815bce3": {"src": "data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAA30AAANKCAYAAAA+9SesAAAAGXRFWHRTb2Z0d2FyZQBBZG9iZSBJbWFnZVJlYWR5ccllPAAAQ3xJREFUeNrs3U2MXceCH/bDfvTMYOhALRgzfoMBRleOQ4fwgs1FNt7wcsUgWohcTDZZsLkzkAAkFwmyI7kLYgMkkeDFWQS83BhwslBrQQNa8TKrAF6wtTCUCHjRlYMAgT2D1wqieB5eRsqpZl3pqtUku/tU1alzzu8HXLT0ZnQ/6nzVvz6bBgAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAA
